// https://leetcode.com/problems/longest-cycle-in-a-graph/
// Hard

class Solution {
public:
    int longestCycle(vector<int>& edges) {
        const int absent = -1;
        std::vector<int> path(edges.size(), 0);
        std::vector<int> seen(edges.size(), -1);
        int max = 0;
        for (int i = 0; i < edges.size(); ++i) {
            // DFS
            int length = 0;
            for (int v = i; seen[v] == -1 && edges[v] != absent && path[v] == 0; v = edges[v]) {
                path[v] = ++length;
                seen[v] = i;
                if (seen[edges[v]] == i) {
                    max = std::max(max, length-path[edges[v]]+1);
                }
            }
        }
        return max ? max : -1;
    }
};

